import './App.css';

import {BrowserRouter as Router, Routes, Route, Link, useLocation} from 'react-router-dom';
import HomePage from './HomePage';
import Questionnaire from './Questionnaire';
import Voice from "./voice";

import Box from '@mui/material/Box';
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import {useEffect, useState} from "react";

function samePageLinkNavigation(event) {
  return !(event.defaultPrevented ||
      event.button !== 0 || // ignore everything but left-click
      event.metaKey ||
      event.ctrlKey ||
      event.altKey ||
      event.shiftKey);

}

function LinkTab(props) {
  return (
    <Tab
      component={Link}
      {...props}
    />
  );
}


function TopBar() {
  const [value, setValue] = useState(0);
  const location = useLocation();

  useEffect(() => {

    if (location.pathname === "/") setValue(0);
    else if (location.pathname === "/voice") setValue(1);
    else if (location.pathname === "/text") setValue(2);
  }, [location]);

  const handleChange = (event, newValue) => {
    // event.type can be equal to focus with selectionFollowsFocus.
    if (event.type === 'click' || (event.type === 'click' && samePageLinkNavigation(event))) {
      setValue(newValue);
    }
  };

  return (
    <Box sx={{ width: '100%' }}>
      <Tabs value={value} onChange={handleChange} aria-label="nav tabs example">
        <LinkTab label="homepage" to="/" />
        <LinkTab label="Voice" to="/voice" />
        <LinkTab label="Text" to="" />
      </Tabs>
    </Box>
  );
}

function App() {
  return (
    <Router>
      <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/questionnaire" element={<Questionnaire />} />
          <Route path="/voice" element={<Voice />} />
      </Routes>
    </Router>
  );
}
export default App;
export {TopBar};
